import React from 'react'
import WorkoutsPage from './WorkoutsPage'

class Workout extends React.Component {
    state = {
        workouts: []
    }

    componentDidMount = () => {
        fetch("/api/workout")
            .then(res => res.json())
            .then(workouts => this.setState({workouts}))
    }



    render() {
        return (
            <WorkoutsPage />
        )
    }
}

export default Workout
